def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""

    result = ""
    for part in input1.split():
        words = part.split('-')
        transformed_words = [words[0]] + [word.capitalize() for word in words[1:]]
        result += " ".join(transformed_words) + " "

    return result.strip()
